>','',1,1,'2017-01-11 22:28:43',1,'2017-01-11 22:35:58',1,'2017-01-11 22:28:43','0000-00-00 00:00:00',0,'','',0,0,NULL),(13,'Helal Ahmed','helal-ahmed','<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Fusce cursus justo at dolor facilisis, eget semper diam dignissim. Pellentesque luctus purus sed faucibus elementum. Sed vehicula sit amet diam finibus rhoncus. In sed gravida leo. Aliquam mattis, erat ac varius pharetra, arcu eros elementum nibh, quis molestie arcu ligula eu elit. Pellentesque accumsan elit ut felis tristique dictum. Quisque scelerisque arcu nec turpis dictum malesuada.</p>\r\n','',1,5,'2017-01-11 22:49:22',1,'2017-01-30 21:14:46',1,'2017-01-11 22:49:22','0000-00-00 00:00:00',0,'','Student Bengali Section',0,0,NULL),(14,'Anis Ahmed','anis-ahmed','<p>Phasellus euismod eros justo, nec malesuada nisl tincidunt eu. Cras blandit pellentesque egestas. In venenatis, lacus ut egestas cursus, elit sem bibendum nulla, at ultricies mauris mi in turpis. Curabitur non ornare lorem. Nullam euismod placerat purus, at laoreet lacus imperdiet in. Proin et neque ac libero suscipit accumsan in quis turpis.</p>\r\n','',1,5,'2017-01-11 22:52:50',1,'0000-00-00 00:00:00',0,'2017-01-11 22:52:50','0000-00-00 00:00:00',0,'','Guardian',0,0,NULL),(15,'Admission Process','admission','<ul>\r\n	<li>\r\n	<p>Children between 3 to 3 &frac12; years of age will be eligible for admission in Playgroup.</p>\r\n	</li>\r\n</ul>\r\n','',1,1,'2017-01-11 23:48:16',1,'2017-12-04 12:03:11',2,'2017-01-11 23:48:16','0000-00-00 00:00:00',0,'','',0,0,'1512367391_pic_1.jpg'),(16,'From the Principal\'s Desk','history','<p>Anwari Kabir</p>\r\n\r\n<p>Founder Principal</p>\r\n\r\n<p>It seems only the other day I started the school with only 56 students and 6 teachers. Inspired by my beloved father Late Jalaluddin Ahmed and under the able guidance of my husband Late Khairul Kabir, the school grew gradually but successfully. From its inception, English has been the medium of instruction but Bangla medium was introduced alongside from 1971.</p>\r\n\r\n<p>Today we celebrate with the big number of 1100 approximate students in the two sections with 135 teaching and non-teaching staff.I take this opprotunity to congratulate all our past and present students, teachers, support staff and the parents who played a big role in the development of the institution, without whose dedication and cooperation we would not have been able to come so far.</p>\r\n\r\n<p>We look forward to new horizons of love and hope ask the blessings of the Almightly Allah for each and all who come to this institution to learn about truth, justice, love and to be sincere to all mankind.</p>\r\n\r\n<p>With much gratitude and appreciation, I extend to all my sincere greetings and best wishes for the years to come and may Allah bless us and keep us all in His loving care.</p>\r\n','',1,1,'2017-01-11 23:48:55',1,'2017-12-11 14:06:22',1,'2017-01-11 23:48:55','0000-00-00 00:00:00',0,'','',0,0,'1512979582_principal.jpg'),(17,'From the Vice Principal\'s Desk','principal’s-message','<p>Sonia Imran</p>\r\n\r\n<p>Vice Principal</p>\r\n\r\n<p>61 years is a long time for any institution. I feel proud and honored to be a part of this prestigious school since its inception.....as a daughter of the founder principal, student, teacher and since 1990 till now, as the administrator of LJS!</p>\r\n\r\n<p>LJS has come a long way in every way under the able and dynamic guidance and leadership of our founder Mrs. Anwari Kabir, my beloved mother, who has been my mentor, guide, role model and my all time inspiration.Felicitations to all past and present members of the teaching and the office staff, who have been instrumental in achieving the present day academic standing of the school.May you continue to shine for the next generation and beyond. This school gets better with age and I look forward to celebrating many more milestones with the best in the country.I extend my gratitude to all those who have had a part to play in the founding and nurturing of our great institution.</p>\r\n\r\n<p>Congratulations for all that has been achieved in the last 61 years and best wishes for the future!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n','',1,1,'2017-01-11 23:49:20',1,'2017-12-11 13:22:36',2,'2017-01-11 23:49:20','0000-00-00 00:00:00',0,'','',0,0,'1512976956_vice_principal_pic.jpg'),(18,'Aims and Vision','aims-and-vision','<p>It seems only the other day I started the school with only 56 students and 6 teachers. Inspired by my beloved father Late Jalaluddin Ahmed and under the able guidance of my husband Late Khairul Kabir, the school grew gradually but successfully. From its inception, English has been the medium of instruction but Bangla medium was introduced alongside from 1971. Today we celebrate with the big number of 1250 students in the sections with 135 teaching and non teaching staff.<br />\r\n<br />\r\nI take this opprotunity to congratulate all our past and present students, teachers, support staff and the parents who played a big role in the development of the institution, without whose dedication and cooperation we would not have been able to come so far.<br />\r\n<br />\r\nWe look forward to new horizons of love and hope as we celobrate the 50th Jubilee and ask the blessings of the Almightly Allah for each and all who come to this institution to learn about truth, justice, love and to be sincere to all mankind.<br />\r\n<br />\r\nWith much gratitude and appreciation, I extend to all my sincere greetings and best wishes for the ocassion and may Allah bless us and keep us all in His loving care.<br />\r\n<br />\r\n<strong>Anwari Kabir</strong><br />\r\nFounder Principal</p>\r\n','',0,1,'2017-01-11 23:49:46',1,'2017-12-04 14:21:40',1,'2017-01-11 23:49:46','0000-00-00 00:00:00',0,'','',0,0,NULL),(19,'Academics','academics','<p><em><strong>We have English Medium and Bengali Medium</strong></em></p>\r\n\r\n<p><em>English Section- Classes Play Group to V</em></p>\r\n\r\n<p><em>Bengali Section- Classes I to V (Under National Curriculum)</em></p>\r\n\r\n<p><em><strong>School Rules : </strong></em></p>\r\n\r\n<ol>\r\n	<li><em>Student must come neatly dressed in School-Uniform : Girls-Khaki tunic, white blouse, khaki belt, red tie, red ribbon, red sweater, with white socks and black shoe, Boys-White shirt, Khaki half pant, red sweater, red tie, white socks andblack shoes. Sports Dress- White T-shirts, white shorts/ Skirts, white T-shirt with white Tennis Shoes and white socks, on Monday &amp; Thursday.</em></li>\r\n	<li><em>Children are not to come to school with ornaments on. Girls must not come with their hair united.</em></li>\r\n	<li><em>In case of absence of students, a letter of explanation by the guardian is essential.</em></li>\r\n	<li><em>Tuition fee should be paid as per the dates given in the fees book, failing of which a fine will be charged according to the rules &amp; regulations of the School.</em></li>\r\n	<li><em>Tuition fee and other fees will be raised any time of the year if necessary to meet the School expenses. Guardians must co-operate with the school decisions.</em></li>\r\n	<li><em>Guardians are requested to maintain the <strong>fees giving dates </strong>for their own convenience and bring <strong>EXACT AMOUNT.</strong></em></li>\r\n	<li><em>If tuition fee for two month is in default, the name of the student concerned will be struck of the roll and re-admission will be necessary; admission fee and all other dues will be charged.</em></li>\r\n	<li><em>The name of any student whose guardian is found to go against the rules of the school and break school discipline will be struck of the roll.</em></li>\r\n	<li><em>School will remain closed on <strong>Fridays</strong> and <strong>Saturdays</strong>.</em></li>\r\n	<li><em>School uniform will be available at - <strong>a.</strong> Mukta Selai Ghar, 31/1, Purana Paltan, Dhaka-1000&nbsp; <strong>b. </strong>The Needel Craft Master Tailors, 5, Purana Paltan,Dhaka.<strong> c.</strong> Decent Tailors, 26, Purana Paltan, Dhaka</em></li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n','',1,1,'2017-01-11 23:51:18',1,'2017-12-11 09:44:09',2,'2017-01-11 23:51:18','0000-00-00 00:00:00',0,'','',0,0,'1512963849_academic.jpg'),(20,'Art Competition 2015 Group B','ljs-art-competition-2015-group-b','<p>Name : Mizanur Rahman<br />\r\nClass : V<br />\r\nRoll : 12<br />\r\nGroup : Shakespeare<br />\r\nDate : 24.05.2015</p>\r\n','',1,6,'2017-01-12 00:22:51',1,'0000-00-00 00:00:00',0,'2017-01-12 00:22:51','0000-00-00 00:00:00',0,'','',0,0,'1484158971_2015110_ljs_art_002.jpg'),(21,'Art Competition 2015 Group A','ljs-art-competition-2015-group-a','<p>Name : Sohel Sadik<br />\r\nClass : III<br />\r\nRoll : 03<br />\r\nGroup : Wordsworth<br />\r\nDate : 24.05.2015</p>\r\n','',1,6,'2017-01-12 00:23:33',1,'0000-00-00 00:00:00',0,'2017-01-12 00:23:33','0000-00-00 00:00:00',0,'','',0,0,'1484159013_2015110_ljs_art_001.jpg'),(22,'Art Competition 2014 Group A','art-competition-2014-group-a','<p>The best drawing<br />\r\nArt Competetion - 2014<br />\r\nGroup A<br />\r\nName : Sidratul Murtaha<br />\r\nClass : III<br />\r\nRoll : 03<br />\r\nGroup : Shakespeare<br />\r\nDate : 10.04.2014</p>\r\n','',1,6,'2017-01-12 00:25:36',1,'2017-02-26 21:12:12',2,'2017-01-12 00:25:36','0000-00-00 00:00:00',0,'','',0,0,'1488165132_201411_ljs_art_002.png'),(23,'Art Competition 2014 Group B','art-competition-2014-group-b','<p>The best drawing<br />\r\nArt Competetion - 2014<br />\r\nGroup B<br />\r\nName : Sanjida Mizi<br />\r\nClass : V<br />\r\nRoll : 07<br />\r\nGroup : Shakespeare<br />\r\nDate : 10.04.2014</p>\r\n','',1,6,'2017-01-12 00:26:18',1,'0000-00-00 00:00:00',0,'2017-01-12 00:26:18','0000-00-00 00:00:00',0,'','',0,0,'1484159178_201411_ljs_art_001.jpg.png'),(24,'Alumni Contribution','alumni-contribution','<p>sfdssgsg</p>\r\n','',1,1,'2017-01-30 21:53:45',1,'2017-12-11 10:27:28',2,'2017-01-30 21:53:45','0000-00-00 00:00:00',0,'','',0,0,'1512966448_3.jpg');

/*Table structure for table `os_content_category` */

DROP TABLE IF EXISTS `os_content_category`;

CREATE TABLE `os_content_category` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `parent_id` int(11) NOT NULL DEFAULT '0' COMMENT 'Parent',
  `title` varchar(255) NOT NULL COMMENT 'Title',
  `alias` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT 'Alias',
  `description` text NOT NULL COMMENT 'Details',
  `path` varchar(255) DEFAULT NULL COMMENT 'Path',
  `published` tinyint(1) NOT NULL DEFAULT '1' COMMENT 'Published',
  `created_by` int(11) DEFAULT NULL COMMENT 'Created By',
  `created_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT 'Created On',
  `modified_by` int(11) DEFAULT NULL COMMENT 'Modified By',
  `modified_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT 'Modified On',
  PRIMARY KEY (`id`),
  KEY `cat_idx` (`published`),
  KEY `idx_alias` (`alias`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8;

