/*Table structure for table `os_user_profile` */

DROP TABLE IF EXISTS `os_user_profile`;

CREATE TABLE `os_user_profile` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `user_id` int(11) NOT NULL COMMENT 'User ID',
  `country_id` int(11) DEFAULT NULL COMMENT 'Country',
  `job_title` varchar(150) DEFAULT NULL COMMENT 'Job Title',
  `company` varchar(150) DEFAULT NULL COMMENT 'Company',
  `company_address` varchar(250) DEFAULT NULL COMMENT 'Company Address',
  `office_phone` varchar(100) DEFAULT NULL COMMENT 'Office Phone',
  `office_email` varchar(150) DEFAULT NULL COMMENT 'Office Email',
  `expiry` date DEFAULT '0000-00-00' COMMENT 'Expiry',
  `state_id` int(11) DEFAULT NULL COMMENT 'State',
  `city_id` int(11) DEFAULT NULL COMMENT 'City',
  `address` varchar(255) DEFAULT NULL COMMENT 'Permanent Address',
  `residence_address` varchar(255) DEFAULT NULL COMMENT 'Residence Address',
  `mobile` varchar(100) DEFAULT NULL COMMENT 'Mobile',
  `phone` varchar(100) DEFAULT NULL COMMENT 'Phone',
  `fax` varchar(100) DEFAULT NULL COMMENT 'Fax',
  `website` varchar(150) DEFAULT NULL COMMENT 'Website',
  `blood_group` varchar(10) DEFAULT NULL COMMENT 'Blood Group',
  `birth_date` date DEFAULT '0000-00-00' COMMENT 'Bith Date',
  `batch` varchar(100) DEFAULT NULL COMMENT 'Batch',
  `nick_name` varchar(100) DEFAULT NULL COMMENT 'Nick Name',
  `profile_picture` varchar(255) DEFAULT NULL COMMENT 'Picture',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_user_id_profile_key` (`user_id`),
  CONSTRAINT `os_user_profile_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `os_user` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='Simple user profile storage table';

