  `expire` int(11) DEFAULT NULL,
  `data` longblob,
  `userId` int(11) DEFAULT NULL,
  `userType` tinyint(1) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

